import { createRouter, createWebHistory } from 'vue-router';
import itemDescription from './components/itemDescription'

const routes = [
    {
        path: '/item',
        name: 'itemDescription',
        component: () => {
            itemDescription
        }
    }
]

const router = createRouter({
    history: createWebHistory(),
    routes
});

export default router;
